// Préfixe pour les assets statiques (gère le homepage de package.json)
const PUBLIC_URL = process.env.PUBLIC_URL || '';

// Fonction pour calculer le win_percentage et ajouter aux équipes
export const getTeamsWithStats = () => {
  return teams.map(team => ({
    ...team,
    logo_url: `${PUBLIC_URL}${team.logo_url}`,
    win_percentage: (team.wins / (team.wins + team.losses)).toFixed(3)
  }));
};

// Fonction pour obtenir les joueurs avec les URLs corrigées
export const getPlayersWithUrls = () => {
  return players.map(player => ({
    ...player,
    team_logo_url: `${PUBLIC_URL}${player.team_logo_url}`,
  }));
};

